import React from 'react';
import { SocketProvider } from './context/SocketContext';
import AdminControls from './components/AdminControls';
import PDFViewer from './components/PDFViewer';
import './styles.css';

const App = () => {
  return (
    <SocketProvider>
      <div className="app-container">
        <h1>PDF Co-Viewer</h1>
        <AdminControls />
        <PDFViewer />
      </div>
    </SocketProvider>
  );
};

export default App;
